import React from 'react';
import {Route, Switch} from "react-router-dom";
import Homepage from './Homepage';
import LogIn from './LogIn';
import Survey from './Survey';
import RouteHelper from './RouteHelper';

export default function Routes (childProps) {
return(
        <Switch location={Route.location}>
             <RouteHelper path="/" exact component={Homepage} props={childProps}/>
             <RouteHelper path="/login" exact component={LogIn} props={childProps}/>
            <RouteHelper path="/survey" exact component={Survey} props={childProps}/>
        </Switch>
    )
}
